import React, {useState, initialStyle} from 'react';

const LastPlayDetail = (data) => {
    const instance = data.props;
    console.log('last play');
    console.log(data.props);

    const canvas = () => {
        const canvas = document.getElementById('canvas');
        const ctx = canvas.getContext("2d");
        const x = instance.locX;
        const y = instance.locY;

        ctx.beginPath();
        ctx.draw(x,y);
    }

    return (
        <canvas id="canvas" className="canvas" width="200" height="100"></canvas>
    )
}

export default LastPlayDetail;
